ge (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]},{"data":{"text/html":["'fitbit'"],"text/latex":["'fitbit'"],"text/markdown":["'fitbit'"],"text/plain":["[1] \"fitbit\""]},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","list.files(path = \"../input\")\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"1633123f","metadata":{"papermill":{"duration":0.011885,"end_time":"2025-12-17T07:32:08.075773","exception":false,"start_time":"2025-12-17T07:32:08.063888","status":"completed"},"tags":[]},"source":["#**INTRODUCTION**\n","\n","This project is a Capstone Case Study for the Google Data Analytics Professional Certificate done by **Alifia Ganjaraharja**.\n","\n","**OVERVIEW OF THE BELLABEAT COMPANY**\n","\n","Bellabeat is the go-to wellness brand for women with an ecosystem of products and services focus on women's health. They are a small successful company with the potential to become a larger player in the global smart device. Found by Urska Srsen and Sando Mur, Bellabeat wants to analyze data that could help unlock new opportunities by gain some marketing strategies.\n","\n","**BUSINESS TASK** \n","\n","Bellabeat wants to analyze the usage of the data from one of their products to understand to gain insights to how consumers are already using their smart devices then use these insights to make high-level-recommendations that will guide their marketing strategy.\n","\n","**STAKEHOLDER**\n","\n","The stakeholder includes:\n","1. Urska Srsen, Bellabeat's co-founder and Chief Executive Officer\n","2. Sando Mur, Mathematician and Bellabeat's Co-founder\n","3. BellaBeat's Marketing Analytics Team\n","\n","#**DATA PREPARATION**\n","\n","**Data Source**:\n","\n","\n","The **FitBit Fitness Tracker Data** dataset by **Mobius** under the license **CCO: Public Domain** was used. This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016.  30 eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","[](http://www.kaggle.com/datasets/arashnic/fitbit) \n","\n","**Data Integrity & Credibility**\n","\n","Dataset does not **ROCCC**:\n","1. The dataset is **not Reliable** since it only shows data from only 30 women. It does not show demographics or geographical data and has a very small sample size.\n","2. The dataset is **not Original**. The provenance section shows that the data has been preprocessed.\n","3. The dataset is **Comprehensive**: The metrics in the dataset matches the needs of Bellabeat.\n","4. The dataset is **not Current**: The dataset was last updated three years ago, displaying data from 2016.\n","5. The dataset is **not Cited**: Data was collected by third party and the author name is blank.\n","\n","**Sorting & Filtering**\n","\n","My analysis is focused on trends in the usage of the app which is why my analysis will be focused on user engagement. "]},{"cell_type":"code","execution_count":2,"id":"a1620c7c","metadata":{"_kg_hide-input":false,"execution":{"iopub.execute_input":"2025-12-17T07:32:08.129981Z","iopub.status.busy":"2025-12-17T07: